function getBrowserName()
{var browser;if(checkUserAgentName('konqueror')){browser="Konqueror";}
else if(checkUserAgentName('safari'))browser="Safari";else if(checkUserAgentName('omniweb'))browser="OmniWeb";else if(checkUserAgentName('opera'))browser="Opera";else if(checkUserAgentName('webtv'))browser="WebTV";else if(checkUserAgentName('icab'))browser="iCab";else if(checkUserAgentName('msie'))browser="IE"
else if(checkUserAgentName('firefox'))browser="Firefox";else if(!checkUserAgentName('compatible')){browser="Netscape"}
else browser="unknown";return browser;}
